import React from "react";
import "../styles/styles.css";
function Cart({ cart }) {
  return (
    <>
      rollType: type, rollGlaze: glaze, rollPack: pack, rollPrice: price,
      rollImage: imageSource, rollAltText: imageAltText,
      <h2 id="cart-roll-type">cartItem.rollType</h2>
      <h3 id="cart-glaze">Glazing: ${cartItem.rollGlaze}</h3>
      <h3 id="cart-pack">Pack Size: ${cartItem.rollPack}</h3>
      <h3 id="cart-pricing">$ ${cartItem.rollPrice}</h3>
    </>
  );
}
export default Cart;
